e\":\"Q822+48 Antony, France\",\"global_code\":\"8FW4Q822+48\"},\"rating\":1.3,\"reference\":\"ChIJfUWKvxB35kcRQ2ljs_FRPaE\",\"reviews\":[{\"author_name\":\"Drekal\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/103060643581180409343\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocL3trTgJ4r7Nj7vBTdNsyzeFHDD-5pLHiW_HGJ0FSwN=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"Absolutely avoid Metropolis Recharge terminals, they are pure crooks who do not send the charging stop codes and continue to charge the charge while the car is unplugged. MORE THAN 100\\u20ac for a recharge of 2h30 and it is impossible to see that the bill continues to increase neither on their apps nor on the web and the customer service categorically refuses to make a refund even though they are able to see that no car is not plugged in!!!! I say it again, they are crooks! A shame that there are only them in Antony and surrounding areas!\",\"time\":1669151644,\"translated\":true},{\"author_name\":\"S&G\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/108409091497546265607\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocKgpJuuPFmIn-G5Ze5T5hSjf4hCyPyKgOiRRhQbpr-g=s128-c0x00000000-cc-rp-mo\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"Be careful, check your invoices: this terminal seems to have a bug (reported since June but still not corrected). It marks an end of charging even though this is not the case. Charging continues as normal but post-charging rates are subsequently billed. The sales department doesn\'t want to hear anything.\\nTo be complete and honest: Other stations on the same network do not seem to have the same problem.\",\"time\":1665412866,\"translated\":true},{\"author_name\":\"Romain D.\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/101172593709726902007\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a\\/ACg8ocLxIEihS1KUifEqhd2VKFEw2vusxHkh7O2XfFXYxFtW=s128-c0x00000000-cc-rp-mo\",\"rating\":2,\"relative_time_description\":\"a year ago\",\"text\":\"I stopped using this network even though I have a station near my house in Bourg-la-Reine. The accumulation of technical problems and the long minutes spent with support took their toll on my patience. I confirm that there was indeed a problem at this same station in Antony. I even called support to report. According to the previous review, this has not been resolved. Too bad, I recommend doing a few extra km to load at the Paris-Saclay urban community. Plus, it\'s cheaper.\",\"time\":1665560974,\"translated\":true},{\"author_name\":\"Ghouibi Ghada\",\"author_url\":\"https:\\/\\/www.google.com\\/maps\\/contrib\\/110438495813825896908\\/reviews\",\"language\":\"en-US\",\"original_language\":\"fr\",\"profile_photo_url\":\"https:\\/\\/lh3.googleusercontent.com\\/a-\\/ALV-UjVj7gLKrY-pP8lbrdBONCxBj_Jpf9Pj1iS2GKPWTSPeHPU=s128-c0x00000000-cc-rp-mo-ba2\",\"rating\":1,\"relative_time_description\":\"a year ago\",\"text\":\"A real scam, they can charge you for post-charging even if your car is not at 100% charge.\\nAvoid Metropolis! They make money by overcharging the 0.53rd, the 1kwh becomes 1 euro\",\"time\":1666093374,\"translated\":true}],\"types\":[\"point_of_interest\",\"establishment\"],\"url\":\"https:\\/\\/maps.google.com\\/?cid=11618532712224352579\",\"user_ratings_total\":4,\"utc_offset\":60,\"vicinity\":\"25 Rue C\\u00e9line, Antony\",\"website\":\"https:\\/\\/www.metropolis-recharge.fr\\/\"},\"status\":\"OK\",\"placeDetailsUrl\":\"https:\\/\\/maps.googleapis.com\\/maps\\/api\\/place\\/details\\/json?place_id=ChIJfUWKvxB35kcRQ2ljs_FRPaE&key=AIzaSyAkKnPU40KJ-27r5Q94gblB7T_eAnPqajM\"}','f837e0ae-f73d-43b6-80b7-141019e3a4